% y=detrend(y);

% bandpass filter lcf = 0.3Hz and hcf = 2Hz

% Moving average filter
% for i=1:(length(y)-fs/5)
% local_sum=0;
% for j=1:fs/5
% local_sum=local_sum+y(i+j);
% end
% y(i)=local_sum/(fs/5);
% end


% y = bpfilt(y,0.3,2,fs,0);


%% eliminate very high frequencies
% paramSet.elim_vhf.ppg.Fpass = 38.5;   % in HZ
