% 
% y=elim_sub_cardiac(y,fs);
% y=y.v;


% x=linspace(0,length(y)/fs,length(y));

figure(1);
plot(x,y);
h=gcf;
axObj = get(h, 'Children');
datObj = get(axObj, 'Children');
xdata = get(datObj, 'XData');
ydata = get(datObj, 'YData');
inp.y=(ydata)';
inp.x=(xdata)';
